  \"2016-10-29T19:05:40.890243\",\n\t\"name\": \"affordable-care-act-aca\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Affordable Care Act (ACA) is a federal
  statute enacted with a goal of increasing the quality and affordability of health
  insurance. Through a web service, CMS sends applicant information to SSA. SSA matches
  applicant data to various SSA data sources and provides a response back to CMS,
  based on the results of the matches. The results of these matches help CMS and states
  determine an applicant's eligibility and cost for health insurance. SSA provides
  results to CMS for matches of SSN, Name, and DOB against the Numident. SSA may also
  provide Incarceration data from PUPS, Title II income from the MBR, and quarters
  of coverage data from the MEF.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
